const array = ['a', 'b', 'c'];
const values = [];
const indices = [];
const arrays = [];
filter(array, (value, index, arr) => {
  values.push(value);
  indices.push(index);
  arrays.push(arr);
  return true;
});
expect(values).to.deep.equal(['a', 'b', 'c']);
expect(indices).to.deep.equal([0, 1, 2]);
expect(arrays).to.deep.equal([array, array, array]);

